import React, { PureComponent } from 'react'
import { Redirect } from 'react-router'

export default class Home extends PureComponent {
     handleClick(e) {
        e.preventDefault();
        console.log('The link was clicked.');
      }

    render() {
        return (
            <div>
                <button onClick={handleClick()}>hello world</button>
            </div>
        )
    }
}
